    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "16. Bey Hern. Rudolf Ransperger an der huthgass ist extra guter Holländer-Salat in hießiger stadt wochentlich à 10 Baten, wie auch extra St. Vincent à 8 Bz. zu haben."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "17. 300 guter Art große Bohnen zum Säen, und kleine weiße dito zum Kochen im billigen Preiß zu haben, ist im Berichthaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "18. Zwey Bartelien oder Professor-huth, wie auch ein ganz neuer Castor-huth, mittelmässiger Größe, im Berichthaus zu erfragen."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "19. Bey Hrn. Sturbardt zum Rüden sind extra neue original Italienische Eisen, sind original Meertrauch mit und ohne Stiel, scharffe und neue Abrechen, feine Cocoladen, alles zu billigem Preiß zu haben."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "20. Wundlich Sach neuer Bäyen im billigen Preiß, im Berichthaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "21. Bey Hrn. Jacob Grimmin können zu haben: 1) Ein Kriegs-Atlas von dem deutschen Land- und Seekriege, sehr sauber in 3 Theilen, 2) Die Durchlauchtigste Welt, 4 Theil mit nachgefaßtem Journal du camp de Compiegne avec h."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "22. Zwey saubere französische Bether in ein Wirtshaus auf das Land oder in ein Bad dienlich unentgeltlich im Berichthaus zu erfragen."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "23. Eine Behausung in der Aeschener Vorstadt mit 6 Stuben, 5 Kammern samt einer grossen Werkstatt, Estrig und einem schönen gewölbten Keller und Garten, woselbst kein Grundzinß. Jacob Wäslin dem Weinhann anzumelden."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "24. Ein Freund, welcher circa 600 Ester Hanf-Saamen anhero liefern könnte, möchte aber solchen vorher verkauft wissen, offerirt selbigen zu haben in billigem Preiß, im Berichthaus zu erfragen."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "25. 30 jahrer alter weisser Wein zu haben, ist bey Hrn. Michael Fuchs dem Küfer zu persuchen."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "26. Circa 6. Saunt extra guter alter rother Margrafer Wein, so auch Neuenburger oder Burgunder, in billigem Preiß, im Berichthaus zu erfragen."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "27. Zwey Stückleir weissen Wein von 1760. à 8 Pfund 10 der Saumt im einen, und à 8 Pfund im andern, wovon nach Belieben zu haben; im Berichthaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "28. Ein Stock Heu ab 3 Lothen Matten vorm Riehenert-Thor oberhalb der Schorenbrut. Ferner ein Stücklein von 17 Saumen rother Margrafer-Wein von 1760, schon trinkbar laut zu haben, im Berichthaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "29. Auf E. Kunst zum Bären sind wiederum 100 Saure Rüben im billigen Preiß zu haben."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "30. Ein vortheilhafter Sammt zu hohen und billigen Preiß, im Berichthaus zu erfragen."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "31. Im Oberburger-Hof ist weisser Wein im billigen Preiß zu haben."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "32. Ein Saum Weinessig bey der Steinen-Mühle im billigen Preiß, im Berichthause ohne Entgelt zu erfragen."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "33. Ein sauberer neuer weissle Margrafer Wein von 1752. Margrafer-Wein im billigen Preiß zu haben; im Berichthaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "34. Eine beitreibselige hamburgische Strick-Wolten das Pfund à 6 Pfund, wo selbste Hinwiederum zu haben ist, im Berichthaus ohne Entgelt zu erfragen."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "35. Ferner solch aus Steigriß Behausung ins Steig-lößlein mit 4 Stuben, 3 Kammern zu verkaufen oder vermiethen, oder samsthaft zu besitzen."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "36. Weisse und rothe Margrafer Weine von 1760, worvon in billigem Preiß nach Belieben zu haben, im Berichthaus zu erfragen."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "37. Ein Mannsitz im St. Peters-Hofe auf dem Rennet. Wein, ein grün Samt ohne Zeitz und grüne wollene Umhängen, im billigen Preiß, im Berichthaus zu erfragen."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "38. Ein Hausstücklein mit einem schönen Bildstock und Garten im billigen Preiß, im Berichthaus zu erfragen."
    },
    {
      "date": "1760-03-20",
      "tags_section": null,
      "ntokens": null,
      "text": "39. Im St. Petersacker-Hof auf St. Peter, mit Garten, Stallung, Keller &c. wie der Augenschein zeigen wird. In Termangulissen. Kaiser."
    }
  ]
}
